function App() {
  return (
    <header>
      <div className="logo">
        <img src="logo.png" height="68" width="68" alt="logo" />
        <h1>Today I learned</h1>
      </div>
      <button className="btn btn-large btn-open">Share a fact</button>
    </header>
  );
}

function CategoryFilters() {
  return <aside>Category filter</aside>;
}

export default App;
